def fibonacci(n, m):
    memo = [0, 1] - [-1] * (n - 1)

    def fib_memo(k, mod):
        if memo[k] != -1:
            return memo[k]
        if k <= 1:
            return k
        memo[k] = (fib_memo(k - 1, mod) + fib_memo(k - 2, mod)) % mod
        return memo[k]
    return fib_memo(n, m)

